import React from "react";
import {
  WorkBg,
  WorkContainer,
  WorkContent,
  WorkFrost,
  AboutFrost2,
} from "./WorkElms";

const Work = () => {
  return (
    <WorkContainer id="work">
      <WorkFrost />
      <AboutFrost2 />
      <WorkBg>
        <WorkContent></WorkContent>
      </WorkBg>
    </WorkContainer>
  );
};
export default Work;
